The brute force approach is to iterate over all sub-arrays, compute their sum, and return the largest one that’s not greater than k. The time complexity of this approach is O(n^3), so it won’t work for large arrays.
A better approach is to use the sliding window technique. We can use two pointers, left and right, to represent the current sub-array. We initialize left to 0 and right to 1, and then we iterate over the array. At each step, we compute the sum of the current sub-array. If the sum is less than or equal to k, we update the maximum sum and the corresponding sub-array. If the sum is greater than k, we move the left pointer to the right until the sum is less than or equal to k again.
The time complexity of this approach is O(n), which is much better than the brute force approach.
Here’s some sample C++ code that implements this approach:
int maxSubArraySum(int a[], int n, int k) {
    int max_sum = INT_MIN;
    int left = 0, right = 1;
    while (right < n) {
        sum += a[right];
        while (sum > k && left < right) {
            sum -= a[left];
        if (sum <= k) {
            max_sum = max(max_sum, sum);
    return max_sum;
